const BlogList = ({blogs,title}) => {
  return (
    <>
      <h2>{title}</h2>
      {blogs.map((elem) => (
        <div className="blog-preview" key={elem.id}>
          <h2 style = {{color:"#f1356d"}}>{elem.title}</h2>
          <p>written by {elem.author}</p>
        </div>
      ))}
    </>
  );
};

export default BlogList;
